import { useDispatch, useSelector } from "react-redux";

const UserPlan = () => {
  const dispatch = useDispatch();
  const { plan, tenure } = useSelector((state) => state.userPlan);
  console.log(plan, tenure);

  function handleTenure(timeOption) {
    console.log(timeOption);
  }

  return (
    <div>
      <button onClick={() => handleTenure("monthly")}>monthly</button>
      <button onClick={() => handleTenure("yearly")}>yearly</button>
    </div>
  );
};

export default UserPlan;
